import React from 'react';
import { Routes, Route } from 'react-router-dom';

import App from '../pages/App';
import splash from '../pages/splash';

const Main = () => {
   return (
      <Switch>
         <Route exact path = '/' element={<App />}></Route>
         <Route exact path = '/splash' element={<splash />}></Route>
      </Switch>
   );
}

export default Main;
